create table  BikeShop (
	id INT,
	name VARCHAR(50),
	price VARCHAR(50),
	frame_id INT,
	rings_front INT,
	rings_back INT,
	brakes_front VARCHAR(50),
	brakes_back VARCHAR(50),
	color VARCHAR(50),
	size INT,
	style TEXT,
	diameter INT,
	type TEXT,
	bike_id INT,
	front_tire_id INT,
	back_tire_id INT
);
